import React from 'react';
import SectionTitle from '../section_title/section_title';
import './about.css'

const aboutBlurbs = ['Hello there!',
'I\'m Justin Santos — a graduate student, programmer, and lover of technology. ' +
'There are more tools at our disposal than any other time in human history; my goal is to utilize these tools to make a smarter tomorrow.',
'My interests include data and algorithm visualization, artificial intelligence, and machine learning.']


class About extends React.Component {
  render() {
    return (
      <div className='about section-wrapper' id='about'>
        <SectionTitle sectionName='about' />
        <div className="about-text-wrapper">{
          aboutBlurbs.map(blurb => (
            <div className="about-text">{blurb}</div>)
          )
        }</div>
      </div>
    )
  }
}

export default About
